import React, { Component } from 'react';

const Info = () => {
  return (
    <div>
      <p>Total Kasus Covid19 di Indonesia</p>
      <ol>
        <li>Dikonfirmasi: 170 rb </li>
        <li>Sembuh: 82.236 </li>
        <li>Meninggal: 5.765 </li>
      </ol>
    </div>
  )
}

export default Info
